import styled from "styled-components";

export const ContributionBox = styled.div`
  display: flex;
  flex-direction: column;
  flex-wrap: wrap;
  ul {
    height: 70px;
  }

  li {
    width: 10px;
    height: 10px;
    margin: 2px;
    border: 0.2px solid black;
  }
`;
